 @brunohenrique9882  Mas nesse caso era lance de ataque do Athlético. Nenhum árbitro acaba o jogo exatamente no final dos acréscimos. Era o último lance do jogo. 

Esse lance do Coritiba foi quase 6 minutos após o fim da partida. O certo era ter acabado logo após a cobrança. 

E cara, sinto muito mas esse lance do Gamalho foi absolutamente nada. Não sei do que tanto reclamam.

 @luccasferreira1674  Atlético sempre foi de série A!
Vc provavelmente nasceu agora.
Certeza que torce para o varmengo, que nem estádio tem.
